style.css:
@-moz-document domain("osu.ppy.sh") {
  .beatmap,
  .beatmap a,
  .bmlistt,
  .changelog_area,
  .playstyle-container,
  .profile-tabs tbody tr td,
  .profileGameModes div a,
  input {
    border-radius              : 0px !important;
    border-top-left-radius     : 0px;
    border-top-right-radius    : 0px;
    border-bottom-right-radius : 0px;
    border-bottom-left-radius  : 0px;
  }

  .beatmap {
    border : solid 1px #000000;
  }

	.spoiler, .spoiler_body span, .spoiler_body {
		background: #000000 !important;
	}

  .active {
    background : #523b8a !important;
  }

  .avatar-holder {
    padding : 0px;
    border  : 1px solid #5f5f5f;
  }

  .tablebg tbody tr td {
    border : none;
  }

  .profileStatLine {
    border-bottom : none;
  }

  #searchArea dl {
    border-bottom : 1px solid #404040;
  }

  .levelPercent {
    border-right : none;
    background   : #000000;
  }

  .bmlist-options > a,
  .bodytopbg,
  .icon-comments,
  div.header.clickable-cell {
    background : rgb(25, 25, 25);
  }

  #playstats,
  #searchArea a.selected,
  #searchArea a:hover,
  #tablist a,
  .beatmapListing > tbody > tr > th,
  .beatmapListing th,
  .bmlist-options,
  .content-infoline,
  .frozen-header,
  .historyp,
  .profileStatHeader,
  .profileStatLine,
  .tablebg.forum_table > tbody > tr > td.row1,
  .tablebg.forum_table > tbody > tr > td.row2,
  div#mw-head-base,
  div#mw-page-base {
    background : rgb(30, 30, 30);
  }

  .beatmap,
  .beatmap:hover,
  .beatmap .small-details,
  .changelog_area,
  .profile-tabs td,
  .profileGameModes a,
  .tablebg .row1:hover,
  .tablebg .row2:hover,
  input,
  input:focus,
  input:hover {
    background : /*[[elemBackground]]*/;
  }

  #tablist a:hover,
  .content-with-bg,
  .footer,
  .pack-msg,
  .sf-menu a:focus,
  .sf-menu a:hover,
  .sf-menu li.sfHover {
    color      : /*[[textColor]]*/;
    background : rgb(40, 40, 40);
  }

  .artist {
    color : /*[[textColor]]*/ !important;
  }

  .blurb,
  .changelog-text,
  .dialog-area,
  .login-dropdown,
  .news-text,
  .peppynote,
  .playstyle-container,
  .postRight,
  .postTime,
  .postbody,
  .quotecontent,
  .reasonpanels > li,
  .reasonpanels > li:hover > i,
  .row1,
  .row1p,
  .sectionContents,
  .tablebgside > tbody > tr > td,
  li.sfHover > ul > li > a {
    background : rgb(60, 60, 60);
  }

  #songinfo td.colour,
  .final_footer,
  .postLeft,
  .posttext,
  .prof-beatmap,
  .row2p,
  .row2,
  div#tablist,
  div.mw-panel,
  table#songinfo {
    color      : /*[[textColor]]*/;
    background : rgb(50, 50, 50);
  }

  .beatmap .tags a:hover,
  .beatmapListing tr.row1p:hover,
  .beatmapListing tr.row2p:hover {
    background : rgb(80, 80, 80);
  }

  #toc,
  .wikitable th,
  table.wikitable {
    background       : rgb(50, 50, 50);
    background-color : rgb(50, 50, 50);
  }

  .beatmap .tags a {
    color      : black;
    border     : rgb(70, 70, 70);
    background : rgb(60, 60, 60);
  }

  .row1p > td > a,
  .row1p > td > a:hover,
  .row2p > td > a,
  .row2p > td > a:hover {
    color : rgb(170, 170, 170);
  }

  #songinfo > tbody > tr > td > a,
  #songinfo td.colour,
  #songinfo td.colour > a,
  .blurb,
  .login-dropdown > form > div.smaller > a,
  .news-text,
  .postTime > a,
  .row1 > td > a,
  .row2 > td > a,
  div.mw-panel div.portal div.body ul li a,
  div.mw-panel div.portal h5 {
    color : /*[[textColor]]*/;
  }

  #songinfo td {
    border-bottom : 1px solid rgb(80, 80, 80);
  }

  #tablist a.active:link,
  #tablist a.active:visited {
    background : rgb(10, 10, 10);
  }

  sf-menu a {
    color : #77297d;
  }

  #general > font,
  .beatmap .title:hover,
  .sf-menu a:visited,
  .sf-menu a,
  a {
    color : /*[[accentColor]]*/ !important;
  }

  .blurb,
  .main-box,
  .news-text {
    border : 1px solid rgb(70,70,70);
  }

  .blog-post {
    background : none;
  }

  .content-with-bg > h1,
  .content-with-bg > h2,
  .forum_posts_table tr:hover,
  .login-open-button,
  .login-open-button:hover,
  .new-user-button:hover,
  .ntitle,
  .prof-beatmap .pp-display,
  .profileGameModes a:hover,
  .row1,
  .row2,
  h1,
  h2 {
    text-shadow : none;
  }

  div#coolheader {
    display : none;
  }

  .changelog_area,
  input,
  input:focus,
  textarea {
    color      : #9292de;
    background : #000000 !important;
  }

  input:focus {
    box-shadow : none;
  }

  #songinfo,
  #tablist {
    border-bottom : 1px solid rgb(168,51,138);
  }

  .posttext {
    border : 1px solid rgb(70,70,70);
  }
}
